window.bookSummaryJSON = "<p><b>Her magic is bound. His secrets are threatening to destroy them both.</b></p> <p>Aileana and Xander have accepted the truth about their mating bond. Now, they're working together to free Aileana from the blood magic binding her. Only then can they continue Xander's century-long search for the map.</p> <p>They soon find out there is no easy solution to their problems. They must journey to the capital, bringing them dangerously close to High King Edgar and his Winged Soldiers in an effort to free her. The earth is calling to Aileana, and time is running out.</p> <p>When Xander's secrets come back to haunt him, they put everything in jeopardy. His very existence puts them both in danger.</p> <p>Nothing is going as planned, and before long, the pair is faced with the hardest choice of them all. They can solidify the mating bondâ€”or they can part ways forever.</p> <p><i>This Rapunzel retelling is a slow burn, enemies-to-lovers romantic fantasy filled with banter, fated mates, fake marriage, and world-building.</i> Of Wings and Briars <i>is book two in The Ithenmyr Chronicles, which is best enjoyed in order. Moderate steam progresses to a series HEA. This book ends on a cliffhanger.</i></p>"; 
